const PLANETS_URL = 'https://swapi-trybe.herokuapp.com/api/planets/?format=json';

export const getPlanets = () => (
  fetch({PLANETS_URL})
    .then((response) => (
      response
      .json()
      .then((json) => (response.ok ? Promise.resolve
        (json) : Promise.reject(json)))
    ))  
);
console.log(getPlanets());
